import './ItemCard.css';
import t_shirt from '../../images/T-Shirt.png'
import ItemModal from '../ItemModal/ItemModal';

function ItemCard() {
    return (
        <li className="item-card">
            <img src={t_shirt} alt="item_picture" className="item-card__image"></img>
            <p className="item-card__title">T-shirt</p>
        </li>
    )
}

export default ItemCard;
